import Dashboard from "@material-ui/icons/Dashboard";
import Person from "@material-ui/icons/Person";
import BubbleChart from "@material-ui/icons/BubbleChart";

// core components/views for Admin layout
import DashboardPage from "views/Dashboard/sellerDashboard";
import UserProfile from "views/UserProfile/UserProfile.js";
// import TableList from "views/TableList/TableList.js";
import StoreProfile from "views/Store/StoreSetup.js";
import ItemList from "views/item/itemlist.js";
// import AllItemList from "views/item/allItemList.js";
import Membership from "views/Membership/membership.js"
import Signout from "views/authentication/signout.js"
import ApplyFeatured from "views/FeatureProduct/applyAsFearuted.js"






   const   dashboardRoutes  = [
   
    {
      path: "/dashboard",
      name: "Dashboard",
      rtlName: "لوحة القيادة",
      icon: Dashboard,
      component: DashboardPage,
      layout: "/store"
    },
    {
      path: "/user",
      name: "User Profile",
      rtlName: "ملف تعريفي للمستخدم",
      icon: Person,
      component: UserProfile,
      layout: "/store"
    },
   
    {
      path: "/store",
      name: "Store Profile",
      rtlName: "ملف تعريفي للمستخدم",
      icon: Person,
      component: StoreProfile,
      layout: "/store"
    },
    {
      path: "/item",
      name: "Item Entry",
      rtlName: "ملف تعريفي للمستخدم",
      icon: Person,
      component: ItemList,
      layout: "/store"
    },
    {
      path: "/apply-featured",
      name: "Feature Product",
      rtlName: "قائمة الجدول",
      icon: "content_paste",
      component: ApplyFeatured,
      layout: "/store"
    },
   
    {
      path: "/membership",
      name: "Membership",
      rtlName: "قائمة الجدول",
      icon: "content_paste",
      component: Membership,
      layout: "/store"
    },
    {
      path: "/signout",
      name: "Signout",
      rtlName: "الرموز",
      icon: BubbleChart,
      component: Signout,
      layout: "/store"
    }
    
  ]


    export default dashboardRoutes
